import React from 'react';
import 'bootstrap';
import './dropdown.css';

const Dropdown = (X, Y) => {
    return (
        <div>
            <div className="Dropdown-container">
                        <span className="dropdown-item">
                            Folder
                        </span>
                        {/* <div className="dropdown-divider"></div> */}
                        <span className="dropdown-item">
                            File upload
                        </span>
                        <span className="dropdown-item">
                            Folder upload
                            {console.log(X)}
                            {console.log(Y)}
                            {/* {coordinates.Y} */}
                        </span>
                    </div>
        </div>
    )
}

export default Dropdown
